content:
작가님 !! 오타가 있네요 &#x27;16살 모습이라도 해도&#x27;
피곤 하셨나봐요 ㅠ 항상 지켜보고 있습니다 ! 힘내세요
작가님 보시게 좋아요좀 눌러주세요

불법사이트 차단&gt;
인터넷 통제다! 이러는 것은 중국 중동 같은 공산국가들 뿐이다 적화 통일이다!
(일베 2중대가 되어버린 불법사이트 들...)

대체 네이버나 여기나 영화화하자는 애들 무슨생각이냐
원작 망칠일 있나 뭐만하면 영화화 하자 드라마화 하자
막상 나와서 배우나 연출 별로면 노잼이다 별로다 하면서 깔놈들이;;

토할땐 이빨을 악다물고 해야합니다(고기먹은후^^)
물은 버리고 건더기는 잘말린 후
뜨거운 물만 부으면 3분요리가 되지요^^;;

마지막 타이밍 지리네요
&#x27;저 작가 잡아&#x27;
작가님 잡아서 빨리 진행시키죠

근데 보안이 생명인데
총으로 누굴쏴갈길거라고 말하고 다녀도되는건가;
왠지 저게 복선으로 깔릴거같다ㅠㅠ

볼수록 긴장타네 ㅡㅡ;;  
랭킹전 &quot;헬로 브리&quot;  한번 보시면 빠져듭니당~
추천도 하시고 랭킹 참여도 하세요~~

이번 화에서는 로렌스를 구해줘의 주제가 드러나는 장면이 나오지 않았나 싶다. 
&#x27;저 좀 구해주세요.&#x27; 
결론은 결제하길 잘했다. ㅠㅠㅠㅠ 젠장 ㅠㅠㅠ 개미지옥에 또 빠졌어 ㅠㅠㅠㅠ

&quot;사람이 바뀌어야 한다&quot;
청초한 이미지의 로렌스를 쏘는 김실장의 작전에서
아들에게 자리를 물려주도록 회장을 쏘는 작전을 생각하는 듯 하네요

일본어 ㄷㄷㄷ 번역이 실제랑 살짝 다르네요. 
1. 맨 처음 회장이 대통령에게 &quot;자네&quot; 라고 하는데, 일본어는 그냥 완전한 반말 &quot;너&quot;에 가까움
2. &quot;회장님&quot; 이라고 하는데 일어로는 &quot;왕님&quot;

소름;;;;;;;;
전반적으로 다르지만
설마 퀸 연아처럼;;;;;;;;

이시국에  드디어;;;;;;;;;;;;;

어케보면 무서운 대단한 작가님;;

흐름상 로렌스는 김연아가 연상되네요;;;

오 드디어 오셨네
나이스 타이밍이기도 하고...
기대하고 있습니다~~~&gt;ㅂ&lt;

&#x27;덤벼, 내가 너는 자신 있다&#x27;

캬~ 시원합니다!!

- 내일 말할 수 없는 1인
